window.bookSummaryJSON = "<p><b>The Donovan Legacy continues in </b><b><i>Entranced</i></b><b>, #1 </b><b><i>New York Times</i></b><b> bestselling author Nora Roberts’ mesmerizing novel about a headstrong detective expanding her mind to paranormal possibilities while opening her hardened heart to love.</b></p> <p>Tough and tenacious, Mary Ellen Sutherland is a private investigator who never gives up on a case or a friend in need. When her friend’s baby is abducted and every clue leads to a dead end, Mel reluctantly turns to Sebastian Donovan, a psychic reputed to possess extraordinary abilities. Despite her skepticism, Sebastian proves to be amazingly gifted—especially when it comes to enchanting Mel, body and soul.</p>"; 
